(24, 'Áo sơ mi nam hoạ tiết SILVER GREY BOIZ vải lụa form rộng unisex', 'ao-so-mi-nam-hoa-tiet-silver-grey-boiz-vai-lua-form-rong-unisex', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, 文泉驛正黑, &quot;WenQuanYi Zen Hei&quot;, &quot;Hiragino Sans GB&quot;, &quot;儷黑 Pro&quot;, &quot;LiHei Pro&quot;, &quot;Heiti TC&quot;, 微軟正黑體, &quot;Microsoft JhengHei UI&quot;, &quot;Microsoft JhengHei&quot;, sans-serif; font-size: 14px; white-space-collapse: preserve;\">THÔNG TIN SẢN PHẨM: Áo sơ mi nam hoạ tiết SILVER GREY BOIZ tay ngắn \r\n- Chất liệu lụa CNK 100%  mềm mại dày dặn  , thoáng mát\r\n- Đường may được gia công tỉ mỉ, chắc chắn.\r\n- Hình in sắc nét, chân thực\r\n\r\n              S: Ngang 50cm - Dài 70cm   ( 45kg - 60kg / dưới 1m65 )\r\n              M: Ngang 52cm - Dài 72cm  ( 60kg - 70kg / 1m65 - 1m74)\r\n              L:  Ngang 54cm - Dài 74cm   ( 70kg - 85kg / 1m75 - 1m85)\r\n\r\n* Bảng size chỉ mang tính chất tham khảo và phù hợp với phần đông khách hàng, Khách hoàn toàn có thể chọn lên hoặc xuống size tuỳ thuộc vào sở thích và form dáng của mình \r\n\r\nBOIZ CAM KẾT: Áo sơ mi nam hoạ tiết SILVER GREY BOIZ tay ngắn \r\n- Sản phẩm 100% giống mô tả. Hình ảnh sản phẩm chân thật ,đầy đủ tem, mác, bao bì cao cấp.\r\n- Hình ảnh sản phẩm Áo sơ mi tay ngăn nam nữ  là ảnh thật do shop tự chụp và giữ bản quyền hình ảnh\r\n- Đảm bảo vải chất lượng chuẩn xuất khẩu.\r\n- Áo được kiểm tra kĩ càng, cẩn thận và tư vấn nhiệt tình trước khi gói hàng giao cho Quý Khách\r\n- Hàng có sẵn, giao hàng ngay khi nhận được đơn \r\n- Hoàn tiền nếu sản phẩm không giống với mô tả\r\n- Chấp nhận đổi hàng khi size không vừa (vui lòng nhắn tin riêng cho shop)\r\n- Giao hàng trên toàn quốc, nhận hàng trả tiền \r\n- Hỗ trợ đổi trả theo quy định của Shopee\r\n\r\n- Quý khách nhận được sản phẩm, vui lòng đánh giá giúp Shop để hưởng thêm nhiều ưu đãi hơn nhé.\r\nLưu ý: Khi bạn gặp bất kì vấn đề gì đừng vội đánh giá Sản Phẩm mà hãy liên hệ Shop để đc hỗ trợ 1 cách tốt nhất  nhé.\r\n\r\n1. Điều kiện áp dụng (trong vòng 07 ngày kể từ khi nhận sản phẩm) Áo sơ mi nam hoạ tiết SILVER GREY BOIZ tay ngắn\r\n- Hàng hoá vẫn còn mới, chưa qua sử dụng \r\n- Hàng hoá bị lỗi hoặc hư hỏng do vận chuyển hoặc do nhà sản xuất \r\n2. Trường hợp được chấp nhận: \r\n- Hàng không đúng size, kiểu dáng như quý khách đặt hàng \r\n- Không đủ số lượng, không đủ bộ như trong đơn hàng \r\n3. Trường hợp không đủ điều kiện áp dụng chính sách: \r\n- Quá 07 ngày kể từ khi Quý khách nhận hàng \r\n- Gửi lại hàng không đúng mẫu mã, không phải sản phẩm của BOIZ\r\n- Không thích, không hợp, đặt nhầm mã, nhầm màu,... \r\nDo màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%</span><br></p>', 290000.00, NULL, 66, 6, 'Yes', 'Yes', 'ASM-02', 'ASM-02', 'Yes', 981, 1, '2024-07-10 05:07:48', '2024-08-01 21:54:54');
