(26, 'Áo Sơ Mi , Sơ Mi Kẻ Sọc Triger Vải Cotton Lụa Phong Cách Trẻ Nam Nữ Mặc Đẹp', 'ao-so-mi-so-mi-ke-soc-triger-vai-cotton-lua-phong-cach-tre-nam-nu-mac-dep', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, 文泉驛正黑, &quot;WenQuanYi Zen Hei&quot;, &quot;Hiragino Sans GB&quot;, &quot;儷黑 Pro&quot;, &quot;LiHei Pro&quot;, &quot;Heiti TC&quot;, 微軟正黑體, &quot;Microsoft JhengHei UI&quot;, &quot;Microsoft JhengHei&quot;, sans-serif; font-size: 14px; white-space-collapse: preserve;\">Áo Sơ Mi , Sơ Mi Kẻ Sọc Triger Vải Cotton Lụa Phong Cách Trẻ Nam Nữ Mặc Đẹp\r\n✔️ Chất liệu: Vải Cotton\r\n\r\nHƯỚNG DẪN CHỌN SIZE ÁO:\r\n- Bảng Size:\r\n- Size M: 1m40-160/45-55kg\r\n- Size L : 1m60-1m70/55kg-65kg\r\n- Size XL: 1m70-1m78/66kg-78kg\r\n\r\n3.HƯỚNG DẪN SỬ DỤNG\r\n- Khuyến khích giặt tay với nước ở nhiệt độ thường, hạn chế để sản phẩm tiếp xúc với chất tẩy hoặc nước giặt có độ tẩy mạnh.\r\n- Nếu giặt máy, sản phẩm nên được lộn trái và cho vào túi giặt.\r\n- Phơi ở nơi bóng râm, tránh ánh nắng trực tiếp. \r\n\r\n4. QUY ĐỊNH ĐỔI TRẢ CỦA SHOPEE\r\n* Điều kiện áp dụng (trong vòng 03 ngày kể từ khi nhận sản phẩm):\r\n	- Hàng hoá vẫn còn mới, chưa qua sử dụng \r\n	- Hàng hóa hư hỏng do vận chuyển hoặc do nhà sản xuất. \r\n*Trường hợp được chấp nhận: \r\n-  Hàng không đúng size, kiểu dáng như quý khách đặt hàng \r\n-  Không đủ số lượng như trong đơn hàng \r\n* Trường hợp không đủ điều kiện áp dụng chính sách Đổi/Trả : \r\n- Quá 03 ngày kể từ khi Quý khách nhận hàng \r\n- Gửi lại hàng không đúng mẫu mã, không phải hàng của shop \r\n\r\n5 .CAM KẾT CỦA SHOP:\r\n- Shop cam kết cả về CHẤT LIỆU cũng như HÌNH ẢNH (đúng với những gì được nêu bật trong phần mô tả sản phẩm)	\r\n- Giá thành thấp nhất thị trường và được bảo hành theo quy định với từng sản phẩm, được đổi trả hàng lỗi trong vòng 3 ngày kể từ khi mua hàng.\r\n\r\n6. LƯU Ý : \r\n-Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%\r